import { $authhost,$host } from "./index";

export const catalog = async () =>{
    const token = localStorage.getItem('token')
    console.log(token)
    const joffrey = await $host.post('api/catalog', {token})
    console.log(joffrey.data)
    if (joffrey){
        return (true)
    }
    else{
        return (false)
    }
}
